  function series( chain, option ) {
    var i = 0;
    var stop = false;
    
    function next() {
      if ( !!stop )
        return null;
      if ( !!option && !!option.infinite )
        i = i % chain.length;
      if ( i < chain.length ) {
        i = i + 1;
        chain[ i -1 ]( next );
      };
    };
    
    next();
    return function() {
      stop = true;
    };
  };

function Quiz() {
  var abcd = {"a": 0, "b": 1, "c": 2, "d": 3};
  var difficulty = [];
  var option_previous = null;
  var progress = Math.min( 1, 1 );

  function ui_answer() {
    var s_answer = [];
    for ( var the_key in abcd )
    s_answer.push(
      Kefir.fromEvents(
        document.querySelector( "choice" + the_key ),
        "click"
      )
    );
    // s_answer.push(
    // 	Kefir.fromEvents(
    // 	  window,
    // 	  "keypress"
    // 	)
   	// );
    var answer = Kefir.merge( s_answer );
    return answer;
  };

  function ui_answer_current( an_element ) {
    if ( an_element == null )
      return null;
    if ( typeof an_element.dataset.choice == "undefined" ) {
      console.log( an_element );
      throw new Error( "Missing attribute: data-choice." );
    };
    return parseInt( an_element.dataset.choice );
  };

  function ui_difficult( a_max_interval ) {
    if ( !a_max_interval ) {
      while (
           difficulty.length > 0
        && difficulty[ difficulty.length -1 ] > 60000
      )
        difficulty.pop();
      //--init
      var result = 0;
      for ( var i = 0; i < difficulty.length; i = i + 1 )
        result += difficulty[ i ];
      result = result / Math.max( 1, difficulty.length );
      if ( result > 0 )
        result = Math.floor( result * 1.1 );
      document.querySelector(
          "responsetime"
        ).textContent =
        //JSON.stringify( difficulty );
        result + "ms";
      difficulty = difficulty.map( function( a ) {
          return ( a + 100 );
        });
      difficulty.push(
        new Date().getTime()
      );
      return result;
    } else {
      var now = new Date().getTime();
      //--eval
      if (
        now -difficulty[ difficulty.length -1 ] < a_max_interval
      ) {
        var was = difficulty.pop();
        if ( difficulty.length == 0 ) {
          difficulty.push(
            a_max_interval
          );
        } else {
          difficulty = difficulty.filter( function( a ) {
            return ( a <= a_max_interval );
          });
        };
        difficulty.push(
          now -was
        );
      };
    };
  };

  function ui_draw( option ) {
    var n_correct = Math.floor( Math.random() * 4 );
    var quiz_type = !!option;
    // var option =
      //!!option && quiz_shuffle( option, n_correct ) || 
    if ( !!option )
      quiz_shuffle( option, n_correct );
    if ( !option )
      var option = {
        "s_choice": quiz_choice( n_correct ),
        "n_correct": n_correct
      };
    document.querySelector( "romaji" ).innerHTML =
      ( !!quiz_type && quiz_l2 || quiz_l1 )(
        option.s_choice,
        option.n_correct
      )[ "q" ];
    for ( var the_key in abcd )
    document.querySelector( "choice" + the_key ).textContent =
      ( !!quiz_type && quiz_l2 || quiz_l1 )(
        option.s_choice,
        option.n_correct
      )[ the_key ];
    document.querySelector( "powerup" ).textContent =
      progress;
    //shallow copy
    option_previous = Object.assign( {}, option);
    if ( !!quiz_type )
     option = null;
    return option;
  };

  function ui_highlight_choice( an_element, n_correct, callback ) {
    var chosen = an_element;
    var correct = null;
    if ( ui_answer_current( chosen ) != null ) {
      if ( ui_answer_current( chosen ) == n_correct ) {
        chosen.style.background = "#BFB";
      } else {
        chosen.style.background = "orange";
        correct = 
          document.querySelector(
            "choice" + Object.keys( abcd )[ n_correct ]
          );
        correct.style.background = "#BFB";
      };
    } else {
        correct =
          document.querySelector(
            "choice" + Object.keys( abcd )[ n_correct ]
          );
        correct.style.background = "#BBB";
    };

    setTimeout( function() {
      if ( !!chosen )
        chosen.style.background = "transparent";
      if ( !!correct )
        correct.style.background = "transparent";
      callback();
    }, 1500 );
  };

  function quiz_choice( n_correct ) {
    var s_key = Object.keys( han );
    var n_key = s_key.length;
    var s_choice = [];
    var was =   {};
    while ( s_choice.length < 4 ) {
      var n_ =
        Math.floor( Math.random() * n_key );
      if ( !was[ n_ ] ) {
        was[ n_ ] = true;
        s_choice.push({
          "l2":     s_key[ n_ ], 
          "l1":     han[ s_key[ n_ ] ][ "l1" ],
          "romaji": han[ s_key[ n_ ] ][ "romaji" ],
          "correct":( n_correct == s_choice.length )
        });
      };
    };
    return s_choice;
  };

  function quiz_l1( s_choice, n_correct ) {
    //http://stackoverflow.com/questions/20817618/is-there-a-splice-method-for-strings
    function spliceSlice(str, index, count, add) {
      return str.slice(0, index) + (add || "") + str.slice(index + count);
    };

    var result = {
      "q":  s_choice[ n_correct ][ "l1" ]
    };
    var n_ = 4;
    var s_word = [];
    var word = s_choice[ n_correct ][ "l2" ];
    for ( var i = 0; i < word.length; i = i + 1 )
    if (
         !!similar_han[ word[ i ] ]
      && similar_han[ word[ i ] ].length > 1
    ) {
      var han = word[ i ];
      var similar = similar_han[ word[ i ] ];
      var j = null;
      while (
           j == null
        || similar[ j ] == han
      )
        j = Math.floor( Math.random() * similar.length );
      similar = spliceSlice( word, i, 1, similar[ j ] );
      s_word.push( similar );
    };

    var i = -1;
    for ( var the_key in abcd )
    if (
         ( i = i + 1 ) == n_correct
      || s_word.length == 0
    ) {
      result[ the_key ] = s_choice[ i ][ "l2" ];
    } else {
      result[ the_key ] = s_word.splice(
        Math.floor( Math.random() * s_word.length ),
        1
      );
    };
    return result;
  };

  function quiz_l2( s_choice, n_correct ) {
    var l2 = s_choice[ n_correct ][ "l2" ];
    if ( !!sentence[ l2 ] ) {
      var n_sentence = sentence[ l2 ][
        Math.floor( Math.random() * sentence[ l2 ].length )
      ];
      var s_char = sentence_temp[ n_sentence ].split( "" );
      s_char.splice(
        sentence_temp[ n_sentence ].indexOf( l2 ),
        l2.length,
        ' <font color="orange">' + l2 + "</font> "
      );
    };
    var result = {
      "q":  !!sentence[ l2 ]
         && s_char.join( "" )
         || l2
    };
    for ( var the_key in abcd )
      result[ the_key ] =
        s_choice[ abcd[ the_key ] ][ "romaji" ];
    return result;
  };

  function quiz_romaji( s_choice, n_correct ) {
    var result = {
      "q":  s_choice[ n_correct ][ "romaji" ]
    };
    for ( var the_key in abcd )
      result[ the_key ] =
        s_choice[ abcd[ the_key ] ][ "l1" ];
    return result;
  };

  function quiz_shuffle( option, temp ) {
    function shuffle( set ) {
      var length = set.length;
      var shuffled = Array(length);
      for (var index = 0, rand; index < length; index++) {
        rand = Math.floor( Math.random() * index );
        if (rand !== index) shuffled[index] = shuffled[rand];
        shuffled[rand] = set[index];
      }
      return shuffled;
    };

    var correct_one = option.s_choice.splice(
      option.n_correct,
      1
    )[ 0 ];
    option.s_choice = shuffle( option.s_choice );
    option.s_choice.splice( temp, 0, correct_one );
    option.n_correct = temp;
    return option;
  };

  function timed( next ) {
    function callback( an_event ) {
      var a1 = {
        "1": "choicea",
        "2": "choiceb",
        "3": "choicec",
        "4": "choiced"
      };
      if ( 
           !!an_event
        && !!an_event.key
      ) {
        an_event = {'target': document.querySelector( a1[ an_event.key ] ) };
        console.log( an_event.target )
      }

      var correct_value =
           !!an_event
        && ui_answer_current( an_event.target )
        || an_event;
      if (
           an_event == null
        || correct_value != option_previous.n_correct
      ) {
        //HP -1
        progress =
          Math.max( 1, progress -1 );
      } else {
        //HP +1
        progress += 1;
        ui_difficult( 4000 );
      };
      quiz.offValue( callback );
      ui_highlight_choice(
        !!an_event && an_event.target || null,
        option_previous.n_correct,
        next
      );
    };

    var answer = ui_answer();
    var timer = Kefir.later(
      ui_difficult() || 4000,
      null
    );
    var quiz = Kefir.merge( [ answer, timer ] 
    //first()
    ).take( 1 ).onValue( callback );
    ui_draw();
  };
  this.timed = timed;

  function wait_for_answer( next ) {
    function callback( an_event ) {
      var correct_value =
        ui_answer_current( an_event.target );
      if ( correct_value != option_previous.n_correct ) {
        //HP -1
        progress =
          Math.max( 1, progress -1 );
      } else {
        //HP +1
        progress += 1;
      };
      answer.offValue( callback );
      ui_highlight_choice(
        an_event.target,
        option_previous.n_correct,
        next
      );
    };

    var answer = ui_answer();
    answer.take( 1 ).onValue( callback );
    ui_draw( option_previous );
  };
  this.wait_for_answer = wait_for_answer;
};

window.onload = function() {
  var container = new DocumentFragment();
  grammar.map( function( a ) {
    var sentence = document.createElement( "div" );
    var tab = a.split( "\t" );
    sentence.innerHTML = [
      tab[ 0 ], tab[ 0 ]
    ].join( "<br>" );
    sentence.title = tab[ 1 ];
    container.appendChild( sentence );
  });
  document.querySelector( "grammar" ).innerHTML = "";
  document.querySelector( "grammar" ).appendChild(
   container
  );

  var quiz = new Quiz();
  series(
    // 1a+2X) timeout
    // 1b+2X) click
    // 2+2X)  click
    [ quiz.timed, quiz.wait_for_answer ],
    { "infinite": true }
  );
};